import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

import LifeCycle from "./components/LifeCycle";

let n = 0;

function add() {
  n++;
}

ReactDOM.render(
  <React.StrictMode>
    <LifeCycle n={n} />
    <button onClick={add}>n+1</button>
  </React.StrictMode>,

  document.getElementById("root")
);
